import Header from "./Header";
import Income from "./Income";

import "./App.css";

function App() {
  const totalMoney = "273.749";

  const nextPlan = "3";

  return (
    <div className="App">
      <Header money={totalMoney} plan={nextPlan} />
      <Income />
    </div>
  );
}

export default App;
